"breadcrumbs" : "CODESYS SVN \/ 安装 SVN 服务器 \/ 支持资源 ", 
"snippet" : "支持资源 “颠覆用户”邮件列表 http:\/\/subversion.apache.org\/mailing-lists.html 具有大量存档的英语邮件列表 （在发送请求之前检查那里。） IRC 聊天频道#svn http:\/\/en.wikipedia.org\/wiki\/Comparison_of_Subversion_clients freenode 网络上的其他 SVN 客户端列表...", 
