"snippet" : "使用 file:\/\/ 仅用于测试目的的访问方法。 您可以通过以下方式访问以 1.8 或 1.9 格式创建的 SVN 存储库 file:\/\/ 协议。 出于测试目的，您可以在不安装自己的服务器的情况下创建本地 SVN 存储库。 SVN 存储库可通过以下方式访问 file:\/\/ 并提供与服务器相同的功能。 使用 TortoiseSVN 创建测试仓库 要求：开发系统上安装了SVN客户端TortoiseSVN 1.9。 在本地文件系统上创建一个新的空文件夹。测试存储库在那里创建。 例子： D:\\SVN repository 点击 TortoiseSVN → 在此处创建存储库 . 这 创建存储库 对话框打...", 
